CREATE FUNCTION public.fn_get_cuota_plazofijo(capital numeric, tea double precision, nro_cuotas integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
declare 
	v_TEM float := fn_get_tem(TEA)/100::float;
begin
	return (capital * v_TEM * ((1+v_TEM)^nro_cuotas)/(((1+v_TEM)^nro_cuotas)-1))::numeric(12,4);
end;
$$;


