CREATE FUNCTION public.fn_get_factor_acum(tea double precision, nro_cuotas integer, fecha0 date, fecha1 date) RETURNS SETOF record
    LANGUAGE plpgsql
    AS $$
declare 
   r record;
   v_fecha timestamp;
   v_periodo integer := 30;
   v_fact_acum float;
   v_TEQ float := (((1+(tea/100::float))^(v_periodo/360::float))-1);
begin
   fecha1 := (fecha1::date)-('1 month'::interval);
   for r in select generate_series(0, nro_cuotas) as num,fecha1 as fecha,0 as dias_acum,cast(0 as float) as factor,cast(0 as float) as acum
   loop
      if(r.num>0) then
         r.fecha := (fecha1::date)+(concat(r.num,' month')::interval);
		 r.dias_acum := EXTRACT(DAY FROM (r.fecha::timestamp-fecha0::timestamp));
         r.factor := (1+v_TEQ)^(-r.dias_acum/v_periodo::float);
         r.acum := v_fact_acum + r.factor;
      else
         r.fecha := fecha0::date;
         r.dias_acum := 0;
      end if;
      return next r;
      v_fecha := r.fecha::timestamp;
      v_fact_acum := r.acum;
   end loop;
end;
$$;


