--

CREATE FUNCTION public.fn_get_letras(numeric) RETURNS text
    LANGUAGE plpgsql
    AS $_$
DECLARE
    unidades CONSTANT text[] := ARRAY['','uno', 'dos', 'tres', 'cuatro', 'cinco', 'seis', 'siete', 'ocho', 'nueve'];
    especiales CONSTANT text[] := ARRAY['once', 'doce', 'trece', 'catorce', 'quince', 'dieciseis', 'diecisiete', 'dieciocho', 'diecinueve'];
	decenas CONSTANT text[] := ARRAY['','diez', 'veinte', 'treinta', 'cuarenta', 'cincuenta', 'sesenta', 'setenta', 'ochenta', 'noventa'];
	centenas CONSTANT text[] := ARRAY['','cien', 'doscientos', 'trescientos', 'cuatrocientos', 'quinientos', 'seiscientos', 'setecientos', 'ochocientos', 'novecientos'];
BEGIN
	$1 = trunc($1);
    IF $1 < 0 THEN RETURN 'menos ' || fn_get_letras(abs($1)); END IF;

    IF($1>=1000000) THEN --millones
		IF(floor($1 / 1000000)=1) THEN
			RETURN 'un millon ' || fn_get_letras($1 % 1000000);
		ELSE
			RETURN fn_get_letras(floor($1 / 1000000)) || ' millones ' || fn_get_letras($1 % 1000000);
		END IF;
	ELSIF($1>=1000 and $1<=999999) THEN --miles
		IF(floor($1/1000)=1) THEN
			RETURN 'un mil ' || fn_get_letras($1 % 1000);
		ELSIF(floor($1/1000)=101) THEN
			RETURN 'ciento un mil ' || fn_get_letras($1 % 1000);
		ELSE
			RETURN fn_get_letras(floor($1 / 1000)) || ' mil ' || fn_get_letras($1 % 1000);
		END IF;
	ELSIF($1>=100 and $1<=999) THEN --centenas
		IF($1 % 100 = 0) THEN
			RETURN centenas[floor($1 / 100)+1];
		ELSE
			IF $1 > 200 THEN RETURN centenas[floor($1 / 100)+1] || ' ' || fn_get_letras($1 % 100); ELSE RETURN 'ciento ' || fn_get_letras($1 % 100); END IF;
		END IF;
	ELSIF($1>=10 and $1<=99) THEN --decenas
		IF($1 % 10 = 0) THEN
			RETURN decenas[floor($1 / 10)+1] || fn_get_letras($1 % 10);
		ELSE
			IF ($1 > 30) THEN RETURN decenas[floor($1 / 10)+1] || ' y ' || fn_get_letras($1 % 10);
			ELSIF ($1 > 20) THEN RETURN 'veinti' || fn_get_letras($1 % 10);
			ELSE RETURN especiales[$1 - 10];
			END IF;
		END IF;
	ELSIF($1<10) THEN --unidades
		RETURN unidades[$1 + 1];
	END IF;
END;
$_$;


