--

CREATE FUNCTION public.fn_get_persona(tipo numeric, ap_paterno text, ap_materno text, nombres text) RETURNS text
    LANGUAGE plpgsql
    AS $$
declare 
	persona text;
begin
	persona = (SELECT CASE tipo WHEN 1 THEN concat(ap_paterno, ' ', ap_materno, ', ', nombres) WHEN 2 THEN nombres::text END as texto);
	return persona;
end;
$$;


