-- Name: fn_get_planpagos_fechafija(numeric, double precision, double precision, integer, date, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.fn_get_planpagos_fechafija(importe numeric, tea double precision, seg_desgr double precision, nro_cuotas integer, fecha0 date, fecha1 date) RETURNS SETOF record
    LANGUAGE plpgsql
    AS $$
DECLARE
   r record;
   v_fecha timestamp;
   v_factorTED float := (((1+(tea/100::float))^(1/360::float))-1); --factor tasa diaria
   v_factorSEG float := (((1+(seg_desgr/100::float))^(1/30::float))-1); --factor seg desgr
   v_TasaMens float := ((1 + v_factorTED + v_factorSEG)^(30::float))-1; --factor tasa mensual
   v_acum float := 0;
   v_cuota numeric := 0; --cuota fija
   v_total numeric := 0;
   v_saldo numeric := 0; 
   v_desgr numeric := 0;
   v_interes numeric := 0;
BEGIN
   fecha1 := (fecha1::date)-('1 month'::interval);
   
    --hallando el factor acumulado (ff) de calculo y la cuota fija
   for r in select generate_series(0, nro_cuotas) as num,fecha1 as fecha,0 as dias_acum,cast(0 as float) as factor
   loop
      if(r.num>0) then
         r.fecha := (fecha1::date)+(concat(r.num,' month')::interval);
         r.dias_acum := EXTRACT(DAY FROM (r.fecha::timestamp-fecha0::timestamp));
         r.factor := (1+(v_TasaMens))^(-r.dias_acum/30::float);
         v_acum := v_acum + r.factor;
      else
	     r.fecha := fecha0::date;
      end if;
      v_fecha := r.fecha::timestamp;
   end loop;
   v_cuota := ROUND((importe * 1 / v_acum)::numeric,1);
   
   --generando el cronograma de pagos
   for r in select generate_series(0, nro_cuotas) as num,fecha1 as fecha,0 as dias,cast(0 as float) as tasa_efec,v_cuota as cuota,cast(0 as numeric) as total,cast(0 as numeric) as capital,cast(0 as numeric) as interes,cast(0 as numeric) as desgr,cast(0 as numeric) as saldo
   loop
      if(r.num>0) then
         r.fecha := (fecha1::date)+(concat(r.num,' month')::interval);
         --r.fecha := CASE(date_part('dow',(fecha1::date)+(concat(r.num,' month')::interval))) WHEN 0 THEN (fecha1::date)+(concat(r.num,' month')::interval)+('1 day')::interval ELSE (fecha1::date)+(concat(r.num,' month')::interval) END;
         r.dias := EXTRACT(DAY FROM(r.fecha::timestamp-v_fecha::timestamp));
         r.tasa_efec := (((1+(tea/100::float))^(r.dias/360::float))-1)*100::float;
         r.desgr := ROUND((v_saldo * seg_desgr/100::float)::numeric,2);
		 r.interes := ROUND((v_saldo * r.tasa_efec/100::float)::numeric,2);
         if(r.num<nro_cuotas) then
		 	r.capital := ROUND(r.cuota - (r.interes+r.desgr),2);
		 	r.total := ROUND(v_cuota + v_desgr,2);
		 else --ultima cuota
            r.capital := ROUND(v_saldo,2);
		 	r.total := ROUND(r.capital + r.interes + r.desgr,2);
		 end if;
		 r.saldo := ROUND(v_saldo - r.capital,2);
      else
         r.fecha := fecha0::date;
         r.saldo := importe;
      end if;
      return next r;
      v_fecha := r.fecha::timestamp;
      v_saldo := r.saldo;
   end loop;
END;
$$;


ALTER FUNCTION public.fn_get_planpagos_fechafija(importe numeric, tea double precision, seg_desgr double precision, nro_cuotas integer, fecha0 date, fecha1 date) OWNER TO postgres;

