--

CREATE FUNCTION public.fn_get_planpagos_plazofijo(importe numeric, tea double precision, seg_desgr double precision, nro_cuotas integer, fecha date, frecuencia integer) RETURNS SETOF record
    LANGUAGE plpgsql
    AS $$
DECLARE
   r record;
   v_fecha timestamp;
   v_factorTED float := (((1+(tea/100::float))^(1/360::float))-1); --factor tasa diaria
   v_factorSEG float := (((1+(seg_desgr/100::float))^(1/30::float))-1); --factor seg desgr
   v_TasaMens float := ((1 + v_factorTED + v_factorSEG)^(30::float))-1; --factor tasa mensual
   v_mes numeric := 0;
   v_acum float := 0;
   v_cuota numeric := 0; --cuota fija
   v_total numeric := 0;
   v_saldo numeric := 0; 
   v_desgr numeric := 0;
   v_interes numeric := 0;
BEGIN
   --hallando el factor acumulado (ff) de calculo y la cuota fija
   for r in select generate_series(0, nro_cuotas) as num,fecha,0 as dias_acum,v_TasaMens as tasamens,cast(0 as float) as factor
   loop
      if(r.num>0) then
         r.fecha := (v_fecha)+(concat(frecuencia,' days')::interval);
         r.dias_acum := EXTRACT(DAY FROM (r.fecha::timestamp-fecha::timestamp));
         r.factor := (1+(r.tasamens))^(-r.dias_acum/30::float);
         v_acum := v_acum + r.factor;
      else
	     r.fecha := fecha::date;
      end if;
      v_fecha := r.fecha;
   end loop;
   v_cuota := ROUND((importe * 1 / v_acum)::numeric,1);
   
   --generando el cronograma de pagos
   for r in select generate_series(0, nro_cuotas) as num,fecha,0 as dias,cast(0 as float) as tasa_efec,v_cuota as cuotaX,cast(0 as numeric) as cuota,cast(0 as numeric) as capital,cast(0 as numeric) as interes,cast(0 as numeric) as desgr,cast(0 as numeric) as saldo
   loop
      if(r.num>0) then
         r.fecha := (v_fecha)+(concat(frecuencia,' days')::interval);
         r.dias := EXTRACT(DAY FROM(r.fecha::timestamp-v_fecha::timestamp));
         r.tasa_efec := (((1+(tea/100::float))^(r.dias/360::float))-1)*100::float;
         r.desgr := CASE (select v_mes=(select EXTRACT(month from r.fecha))) WHEN true THEN 0 ELSE ROUND((v_saldo * seg_desgr/100::float)::numeric,2) END;
		 r.interes := ROUND((v_saldo * r.tasa_efec/100::float)::numeric,2);
         if(r.num<nro_cuotas) then
		 	r.capital := ROUND(r.cuotaX - (r.interes+r.desgr),2);
		 	r.cuota := ROUND(v_cuota + v_desgr,2);
		 else --ultima cuota
            r.capital := ROUND(v_saldo,2);
		 	r.cuota := ROUND(r.capital + r.interes + r.desgr,2);
		 end if;
		 r.saldo := ROUND(v_saldo - r.capital,2);
         v_mes := (select extract(month from r.fecha));
      else
         r.fecha := fecha::date;
         r.saldo := importe;
      end if;
      return next r;
      
      v_fecha := r.fecha;
      v_saldo := r.saldo;
   end loop;
END;
$$;


