-- Name: fn_get_ted(double precision); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.fn_get_ted(tea double precision) RETURNS double precision
    LANGUAGE plpgsql
    AS $$
declare 
   v_porc float := 100.00;
   v_anual float := 360.00;
   v_TEA float := tea/v_porc;
begin
   return (((1+v_TEA)^(1/v_anual))-1)*v_porc;
end;
$$;


