-- Name: sp_desembolsos(character varying, integer, integer, integer, integer, integer, integer, integer, numeric, numeric, numeric, integer, date, integer, character varying, character varying, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sp_desembolsos(p_tipo_exec character varying, p_id integer, p_id_socio integer, p_id_coopac integer, p_id_agencia integer, p_id_producto integer, p_id_moneda integer, p_id_tipopago integer, p_importe numeric, p_tasa numeric, p_desgr numeric, p_nrocuotas integer, p_fecha_otorga date, p_id_tipocred integer, p_pivot character varying, p_sys_ip character varying, p_sys_user integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$DECLARE 
	p_movimID integer := 0;
	p_movimTipoOper integer := 124;
	p_movimCode character varying := '';
	p_detalleID integer := 0;
	p_tipo_movID integer := 9;
BEGIN
	case p_tipo_exec
		when 'DESEM' then -- ejecuta DESEMBOLSO
			--insertamos movim
			p_movimID := (select coalesce(max(id)+1,1) from bn_movim);
			p_movimCode := concat(p_sys_user,'-',(select right('0000000'||cast(coalesce(max(right(codigo,7)::integer)+1,1) as text),7) from bn_movim where id_cajera=p_sys_user));
			--insertamos detalle de movim
			p_detalleID := (select coalesce(max(id)+1,1) from bn_movim_det);
			
			--actualizamos la cabecera del prestamo
			update bn_saldos set 
				saldo = saldo * (-1),
				estado = 1,
				sys_ip = p_sys_ip,
				sys_user = p_sys_user,
				sys_fecha = now()
			where id = p_id;
			
			--agregamos el detalle del prestamo
			case 
				when p_id_tipocred=1 then 
					select p_id,num,fecha,capital,interes,otros,saldo,0,0,0,0,concat('[{"id":13,"descri":"PAGO SEGURO DESGR","monto":',otros::float,'}]'),0,null,null 
					from fn_get_planpagos_fechafija (p_importe,p_tasa,p_desgr,p_nrocuotas,p_fecha_otorga,p_pivot::date) 
					as (num integer,fecha date,dias integer,tasa_efec float,cuotax numeric,cuota numeric,capital numeric,interes numeric,otros numeric,saldo numeric);
				when p_id_tipocred=2 then 
					select p_id,num,fecha,capital,interes,otros,saldo,0,0,0,0,concat('[{"id":13,"descri":"PAGO SEGURO DESGR","monto":',otros::float,'}]'),0,null,null 
					from fn_get_planpagos_plazofijo (p_importe,p_tasa,p_desgr,p_nrocuotas,p_fecha_otorga,p_pivot::integer) 
					as (num integer,fecha date,dias integer,tasa_efec float,cuotax numeric,cuota numeric,capital numeric,interes numeric,otros numeric,saldo numeric);
				end case;
		when 'DELDSMB' then --borrar un estado de desembolso
			update bn_saldos set 
				estado = 3,
				sys_ip = p_sys_ip,
				sys_user = p_sys_user,
				sys_fecha = now() 
			where id=p_id;
			update bn_prestamos set 
				id_aprueba = null,
				fecha_aprueba = null
			where id_saldo = p_id;
	end case;
	return p_movimID;
END;
$$;


