CREATE FUNCTION public.sp_personas(p_tipo_exec character varying, p_id integer, p_tipo_persona integer, p_nombres character varying, p_ap_paterno character varying, p_ap_materno character varying, p_nro_dui character varying, p_id_dui integer, p_id_sexo integer, p_id_ginstruccion integer, p_id_ecivil integer, p_id_ubigeo integer, p_id_tipovivienda integer, p_id_paisnac integer, p_fecha_nac date, p_lugar_nac character varying, p_telefijo character varying, p_celular character varying, p_email character varying, p_profesion character varying, p_ocupacion character varying, p_direccion character varying, p_referencia character varying, p_medidorluz character varying, p_medidoragua character varying, p_urlfoto character varying, p_observac character varying, p_sys_ip character varying, p_sys_user integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$BEGIN
	if (select p_tipo_exec='INS') then --ejecuta INSERT
		p_id := (select coalesce(max(id)+1,1) from personas);
	else --ejecuta UPDATE
		update personas set 
			tipo_persona=p_tipo_persona,
			nombres=upper(p_nombres),
			ap_paterno=upper(p_ap_paterno),
			ap_materno=upper(p_ap_materno),
			nro_dui=p_nro_dui,
			id_dui=p_id_dui,
			id_sexo=p_id_sexo,
			id_ginstruccion=p_id_ginstruccion,
			id_ecivil=p_id_ecivil,
			id_ubigeo=p_id_ubigeo,
			id_tipovivienda=p_id_tipovivienda,
			id_paisnac=p_id_paisnac,
			fecha_nac=p_fecha_nac,
			lugar_nac=upper(p_lugar_nac),
			telefijo=p_telefijo,
			celular=p_celular,
			email=lower(p_email),
			profesion=upper(p_profesion),
			ocupacion=upper(p_ocupacion),
			direccion=upper(p_direccion),
			referencia=upper(p_referencia),
			medidorluz=p_medidorluz,
			medidoragua=p_medidoragua,
			urlfoto=lower(p_urlfoto),
			observac=upper(p_observac),
			sys_ip=p_sys_ip,
			sys_user=p_sys_user,
			sys_fecha = now()
		where id=p_id;
	end if;
	return p_id;
END;
$$;


ALTER FUNCTION public.sp_personas(p_tipo_exec character varying, p_id integer, p_tipo_persona integer, p_nombres character varying, p_ap_paterno character varying, p_ap_materno character varying, p_nro_dui character varying, p_id_dui integer, p_id_sexo integer, p_id_ginstruccion integer, p_id_ecivil integer, p_id_ubigeo integer, p_id_tipovivienda integer, p_id_paisnac integer, p_fecha_nac date, p_lugar_nac character varying, p_telefijo character varying, p_celular character varying, p_email character varying, p_profesion character varying, p_ocupacion character varying, p_direccion character varying, p_referencia character varying, p_medidorluz character varying, p_medidoragua character varying, p_urlfoto character varying, p_observac character varying, p_sys_ip character varying, p_sys_user integer) OWNER TO postgres;

--
-- Name: sp_personas_labo(character varying, integer, integer, integer, character varying, character varying, character varying, character varying, integer, character varying, character varying, numeric, date, character varying, integer, character varying, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sp_personas_labo(p_tipo_exec character varying, p_id integer, p_id_persona integer, p_condicion integer, p_empresa character varying, p_ruc character varying, p_telefono character varying, p_rubro character varying, p_id_ubigeo integer, p_direccion character varying, p_cargo character varying, p_ingreso numeric, p_fechaini date, p_observac character varying, p_estado integer, p_sys_ip character varying, p_sys_user integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$ 
BEGIN
	if (select p_tipo_exec='INS') then --ejecuta INSERT
		p_id := (select coalesce(max(id)+1,1) from personas_labo);
	elsif(select p_tipo_exec='UPD') then --ejecuta UPDATE
		update personas_labo set condicion=p_condicion,
			empresa=upper(p_empresa),
			ruc=p_ruc,
			telefono=p_telefono,
			rubro=upper(p_rubro),
			id_ubigeo=p_id_ubigeo,
			direccion=upper(p_direccion),
			cargo=upper(p_cargo),
			ingreso=p_ingreso,
			fecha_ini=p_fechaini,
			observac=upper(p_observac),
			sys_ip=p_sys_ip,
			sys_user=p_sys_user,
			sys_fecha = now()
		where id=p_id;
	elsif(select p_tipo_exec='ERS') then --ejecuta borrado logico
		update personas_labo set estado=0,sys_ip=p_sys_ip,sys_user=p_sys_user,sys_fecha = now() where id=p_id;
	elsif(select p_tipo_exec='DEL') then --ejecuta DELETE
		delete from personas_labo where id=p_id;
	end if;
	return p_id;
END
$$;


ALTER FUNCTION public.sp_personas_labo(p_tipo_exec character varying, p_id integer, p_id_persona integer, p_condicion integer, p_empresa character varying, p_ruc character varying, p_telefono character varying, p_rubro character varying, p_id_ubigeo integer, p_direccion character varying, p_cargo character varying, p_ingreso numeric, p_fechaini date, p_observac character varying, p_estado integer, p_sys_ip character varying, p_sys_user integer) OWNER TO postgres;

--
-- Name: sp_personas_rela(character varying, integer, integer, integer, integer, character varying, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sp_personas_rela(p_tipo_exec character varying, p_id_conyuge1 integer, p_id_conyuge2 integer, p_id_relacion integer, p_tiemporela integer, p_sys_ip character varying, p_sys_user integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$BEGIN
	IF (select p_tipo_exec='INS') THEN --ejecuta INSERT
	ELSIF (select p_tipo_exec='UPD') THEN --ejecuta UPDATE
		update personas_rela set 
			tiemporelacion = (p_tiemporela::smallint),
			sys_ip = p_sys_ip,
			sys_user = p_sys_user,
			sys_fecha = now()
		where (id_persona1=p_id_conyuge1 or id_persona2=p_id_conyuge1) and id_relacion=p_id_relacion;
	ELSIF (select p_tipo_exec='DEL') THEN --ejecuta DELETE
		delete from personas_rela where (id_persona1=p_id_conyuge1 or id_persona2=p_id_conyuge1) and id_relacion=p_id_relacion;
	END IF;
	return p_id_conyuge1;
END
$$;


ALTER FUNCTION public.sp_personas_rela(p_tipo_exec character varying, p_id_conyuge1 integer, p_id_conyuge2 integer, p_id_relacion integer, p_tiemporela integer, p_sys_ip character varying, p_sys_user integer) OWNER TO postgres;

--
-- Name: sp_prestamos(character varying, integer, integer, integer, integer, integer, integer, integer, integer, integer, integer, integer, integer, integer, numeric, numeric, numeric, numeric, numeric, integer, date, date, date, date, integer, integer, smallint, character varying, integer, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sp_prestamos(p_tipo_exec character varying, p_id integer, p_id_socio integer, p_id_coopac integer, p_id_agencia integer, p_id_promotor integer, p_id_analista integer, p_id_aprueba integer, p_id_producto integer, p_id_tiposbs integer, p_id_destsbs integer, p_id_clasifica integer, p_id_condicion integer, p_id_moneda integer, p_importe numeric, p_saldo numeric, p_tasa numeric, p_mora numeric, p_desgr numeric, p_nrocuotas integer, p_fecha_solicred date, p_fecha_aprueba date, p_fecha_otorga date, p_fecha_pricuota date, p_id_tipocred integer, p_frecuencia integer, p_estado smallint, p_sys_ip character varying, p_sys_user integer, p_observac text) RETURNS integer
    LANGUAGE plpgsql
    AS $$declare 
	p_codigo character varying := '';
BEGIN
	case p_tipo_exec 
		when 'INS' then --ejecuta INSERT
			p_id := (select coalesce(max(id)+1,1) from bn_saldos);
			p_codigo := (select concat(to_char(now(),'YYYYMMDD'),'-',right('000000'||cast(coalesce(max(right(codigo,4)::integer)+1,1) as text),4)) as code from bn_saldos where left(codigo,8)=to_char(now(),'YYYYMMDD') and id_coopac=p_id_coopac);
		when 'UPD' then --ejecuta UPDATE
			update bn_saldos set
				id_socio = p_id_socio,
				id_producto = p_id_producto,
				id_moneda = p_id_moneda,
				saldo = p_saldo,
				sys_ip = p_sys_ip,
				sys_user = p_sys_user,
				sys_fecha = now()
			where id = p_id;
			update bn_prestamos set
				id_agencia = p_id_agencia,
				id_promotor = p_id_promotor,
				id_analista = p_id_analista,
				id_tiposbs = p_id_tiposbs,
				id_destsbs = p_id_destsbs,
				id_clasifica = p_id_clasifica,
				id_condicion = p_id_condicion,
				importe = p_importe,
				tasa_cred = p_tasa,
				tasa_mora = p_mora,
				tasa_desgr = p_desgr,
				nro_cuotas = p_nrocuotas,
				fecha_solicred = p_fecha_solicred,
				fecha_otorga = p_fecha_otorga,
				fecha_pricuota = p_fecha_pricuota,
				id_tipocred = p_id_tipocred,
				frecuencia = p_frecuencia,
				observac = p_observac
			where id_saldo = p_id;
		when 'APRU' then --ejecuta APRUEBA
			update bn_saldos set
				estado = p_estado,
				sys_ip = p_sys_ip,
				sys_user = p_sys_user,
				sys_fecha = now()
			where id = p_id;
			update bn_prestamos set
				id_aprueba= p_id_aprueba,
				fecha_aprueba = now()
			where id_saldo = p_id;
	end case;
	return p_id;
END;
$$;


