CREATE FUNCTION public.tr_borrar_empleados() RETURNS trigger
    LANGUAGE plpgsql
    AS $$begin
	delete from bn_usuarios where id=old.id_empleado;
	delete from bn_billetaje where id_empleado=old.id_empleado;
	delete from bn_movim where id_cajera=old.id_empleado;
	return old;
end;
$$;


ALTER FUNCTION public.tr_borrar_empleados() OWNER TO postgres;

