-- Name: tr_borrar_personas(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.tr_borrar_personas() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
	delete from personas_rela where (id_persona1=old.id or id_persona2=old.id);
	return old;
end;
$$;


