CREATE FUNCTION public.tr_borrar_socios() RETURNS trigger
    LANGUAGE plpgsql
    AS $$begin
	delete from bn_saldos where id_socio=old.id_socio;
	delete from bn_movim where id_socio=old.id_socio;
	return old;
end;
$$;


