--
-- Name: vw_empleados; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_empleados AS
 SELECT e.id_empleado,
    e.id_coopac,
    e.id_agencia,
    e.codigo,
    pe.nro_dui,
    public.fn_get_persona((pe.tipo_persona)::numeric, (pe.ap_paterno)::text, (pe.ap_materno)::text, (pe.nombres)::text) AS empleado,
    e.nombrecorto,
    c.nombre AS cargo,
    a.nombre AS agencia,
    u.login,
    e.estado
   FROM ((((public.bn_empleados e
     JOIN public.personas pe ON ((e.id_empleado = pe.id)))
     JOIN public.sis_tipos c ON ((e.id_cargo = c.id)))
     JOIN public.bn_bancos a ON ((e.id_agencia = a.id)))
     LEFT JOIN public.bn_usuarios u ON (((e.id_empleado = u.id) AND (e.id_coopac = u.id_coopac))));


ALTER TABLE public.vw_empleados OWNER TO postgres;

--
-- Name: vw_movim; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_movim AS
 SELECT c.id,
    c.id_coopac,
    c.id_agencia,
    c.id_tipo_oper,
    c.id_tipo_pago,
    c.id_moneda,
    c.id_socio,
    c.id_saldo AS id_tabla,
    c.id_producto,
    c.id_cajera,
    c.fecha,
    c.codigo,
    c.importe AS importe_cab,
    c.estado,
    c.sys_ip,
    c.sys_user,
    c.sys_fecha,
    c.observac,
    d.id AS id_det,
    d.id_tipo_mov,
    d.item,
    d.importe AS importe_det,
    b.codigo AS codagenc,
    e.codigo AS coduser,
    so.codigo AS codsocio,
    public.fn_get_persona((pe.tipo_persona)::numeric, (pe.ap_paterno)::text, (pe.ap_materno)::text, (pe.nombres)::text) AS socio,
    p.codigo AS codprod,
    p.nombre AS producto,
    s.codigo AS codmov,
    s.nombre AS movim,
    s.in_out,
    s.afec_prod
   FROM (((((((public.bn_movim c
     JOIN public.bn_bancos b ON ((c.id_agencia = b.id)))
     JOIN public.bn_movim_det d ON ((c.id = d.id_movim)))
     JOIN public.bn_socios so ON ((c.id_socio = so.id_socio)))
     JOIN public.personas pe ON ((c.id_socio = pe.id)))
     JOIN public.bn_productos p ON ((c.id_producto = p.id)))
     JOIN public.bn_empleados e ON ((c.id_cajera = e.id_empleado)))
     JOIN public.sis_mov s ON ((d.id_tipo_mov = s.id)));


ALTER TABLE public.vw_movim OWNER TO postgres;

