--
-- Name: vw_prestamos_ext; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_prestamos_ext AS
 SELECT sa.id,
    sa.codigo,
    public.fn_get_persona((p.tipo_persona)::numeric, (p.ap_paterno)::text, (p.ap_materno)::text, (p.nombres)::text) AS socio,
    ax.nombre AS dui,
    p.nro_dui,
    sa.id_socio,
    sa.id_moneda,
    sa.id_coopac,
    pr.id_agencia,
    pr.id_aprueba,
    pr.id_tipocred,
    sa.id_producto,
    b.nombre AS agencia,
    pm.nombrecorto AS promotor,
    an.nombrecorto AS analista,
    ap.nombrecorto AS aprueba,
    du.nombre AS producto,
    ts.nombre AS tiposbs,
    ds.nombre AS destsbs,
    cl.nombre AS clasifica,
    co.nombre AS condicion,
    mo.nombre AS moneda,
    mo.abrevia AS mon_abrevia,
    pr.importe,
    sa.saldo,
    pr.tasa_cred,
    pr.tasa_mora,
    pr.tasa_desgr,
    pr.nro_cuotas,
    pr.fecha_solicred,
    pr.fecha_otorga,
    pr.fecha_pricuota,
        CASE pr.id_tipocred
            WHEN 1 THEN 'Fecha Fija'::text
            WHEN 2 THEN 'Plazo Fijo'::text
            WHEN NULL::integer THEN ''::text
            ELSE NULL::text
        END AS tipocred,
    pr.frecuencia,
    sa.estado,
    sa.sys_ip,
    sa.sys_fecha,
    pr.observac
   FROM (((((((((((((public.bn_prestamos pr
     JOIN public.bn_saldos sa ON ((pr.id_saldo = sa.id)))
     JOIN public.personas p ON ((sa.id_socio = p.id)))
     JOIN public.personas_tipos_aux ax ON ((p.id_dui = ax.id)))
     JOIN public.bn_bancos b ON ((pr.id_agencia = b.id)))
     JOIN public.bn_empleados pm ON ((pr.id_promotor = pm.id_empleado)))
     JOIN public.bn_empleados an ON ((pr.id_analista = an.id_empleado)))
     LEFT JOIN public.bn_empleados ap ON ((pr.id_aprueba = ap.id_empleado)))
     JOIN public.bn_productos du ON ((sa.id_producto = du.id)))
     JOIN public.sis_tipos ts ON ((pr.id_tiposbs = ts.id)))
     JOIN public.sis_tipos ds ON ((pr.id_destsbs = ds.id)))
     JOIN public.sis_tipos cl ON ((pr.id_clasifica = cl.id)))
     JOIN public.sis_tipos co ON ((pr.id_condicion = co.id)))
     JOIN public.sis_tipos mo ON ((sa.id_moneda = mo.id)));


ALTER TABLE public.vw_prestamos_ext OWNER TO postgres;

--
-- Name: vw_prestamos_min; Type: VIEW; Schema: public; Owner: postgres
