CREATE VIEW public.vw_prestamos_min AS
 SELECT sa.id,
    sa.codigo,
    sa.id_coopac,
    pe.nro_dui,
    public.fn_get_persona((pe.tipo_persona)::numeric, (pe.ap_paterno)::text, (pe.ap_materno)::text, (pe.nombres)::text) AS socio,
    pr.fecha_solicred,
    pr.fecha_otorga,
    tp.nombre AS tipo_oper,
    du.nombre AS producto,
    mo.abrevia AS mon_abrevia,
    ts.nombre AS tipo_sbs,
    td.nombre AS dest_sbs,
    pr.tasa_cred AS tasa,
    pr.importe,
    sa.saldo,
    pr.nro_cuotas,
    sa.estado
   FROM (((((((public.bn_prestamos pr
     JOIN public.bn_saldos sa ON ((pr.id_saldo = sa.id)))
     JOIN public.personas pe ON ((sa.id_socio = pe.id)))
     JOIN public.bn_productos du ON ((sa.id_producto = du.id)))
     JOIN public.sis_tipos tp ON ((du.id_tipo_oper = tp.id)))
     JOIN public.sis_tipos ts ON ((pr.id_tiposbs = ts.id)))
     JOIN public.sis_tipos td ON ((pr.id_destsbs = td.id)))
     JOIN public.sis_tipos mo ON ((sa.id_moneda = mo.id)));


ALTER TABLE public.vw_prestamos_min OWNER TO postgres;

