--
-- Name: vw_saldos; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_saldos AS
 SELECT s.id,
    s.id_coopac,
    s.id_socio,
    s.id_tipo_oper,
    s.id_producto,
    s.codigo AS cod_prod,
    s.saldo,
    s.estado,
    s.sys_ip,
    s.sys_user,
    s.sys_fecha,
    ax.nombre AS dui,
    p.nro_dui,
    public.fn_get_persona((p.tipo_persona)::numeric, (p.ap_paterno)::text, (p.ap_materno)::text, (p.nombres)::text) AS socio,
    du.nombre AS producto,
    du.obliga,
    m.nombre AS moneda,
    m.abrevia AS m_abrevia
   FROM ((((public.bn_saldos s
     JOIN public.personas p ON ((s.id_socio = p.id)))
     JOIN public.personas_tipos_aux ax ON ((p.id_dui = ax.id)))
     JOIN public.bn_productos du ON ((s.id_producto = du.id)))
     JOIN public.sis_tipos m ON ((s.id_moneda = m.id)));


ALTER TABLE public.vw_saldos OWNER TO postgres;

--
-- Name: vw_socios; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_socios AS
 SELECT s.id_socio,
    s.id_coopac,
    p.tipo_persona,
    s.codigo,
    s.fecha,
    public.fn_get_persona((p.tipo_persona)::numeric, (p.ap_paterno)::text, (p.ap_materno)::text, (p.nombres)::text) AS persona,
    dx.nombre AS dui,
    p.nro_dui,
    p.urlfoto,
    p.direccion,
    s.estado
   FROM ((public.bn_socios s
     JOIN public.personas p ON ((p.id = s.id_socio)))
     JOIN public.personas_tipos_aux dx ON ((p.id_dui = dx.id)));


ALTER TABLE public.vw_socios OWNER TO postgres;

--
-- Name: vw_ubigeo; Type: VIEW; Schema: public; Owner: postgres
