CREATE VIEW public.vw_ubigeo AS
 SELECT d.id AS id_distrito,
    d.codigo,
    d.nombre AS distrito,
    p.id AS id_provincia,
    p.nombre AS provincia,
    r.id AS id_region,
    r.nombre AS region
   FROM ((public.sis_ubigeo r
     JOIN public.sis_ubigeo p ON ((p.id_padre = r.id)))
     JOIN public.sis_ubigeo d ON ((d.id_padre = p.id)));


