--
-- Name: vw_usuarios; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_usuarios AS
 SELECT u.id AS id_usuario,
    u.id_coopac,
    u.id_rol,
    u.login,
    u.passw,
    p.urlfoto,
    e.nombrecorto,
    e.id_agencia,
    t.nombre AS cargo,
    u.menu
   FROM (((public.bn_usuarios u
     JOIN public.personas p ON ((u.id = p.id)))
     JOIN public.bn_empleados e ON ((u.id = e.id_empleado)))
     JOIN public.sis_tipos t ON ((e.id_cargo = t.id)));


ALTER TABLE public.vw_usuarios OWNER TO postgres;

